import * as React from 'react';
import './App.css';
import Header from './components/Header';
import {Table} from 'antd'


function App() {
  const columns= [
    {
      title: 'Name',
      dataIndex: 'name',
      key: 'name',
      render: text => <a>{text}</a>,
    },
  ]
  const data =[  {
    key: '1',
    name: 'John Brown',
    age: 32,
    address: 'New York No. 1 Lake Park',
    tags: ['nice', 'developer'],
  },]
  return (
    <div className="App">
       <Header/>
       <Table columns={columns} dataSource={data} />
    </div>
  );
}

export default App;
